    startLine: 75
  assemblies:
  - Google.Api.CommonProtos
  namespace: Google.Api
  summary: "\nAlpha is a limited availability test for releases before they are cleared\nfor widespread use. By Alpha, all significant design issues are resolved\nand we are in the process of verifying functionality. Alpha customers\nneed to apply for access, agree to applicable terms, and have their\nprojects whitelisted. Alpha releases don’t have to be feature complete,\nno SLAs are provided, and there are no technical support obligations, but\nthey will be far enough along that customers can actually use them in\ntest environments or for limited-use tests -- just like they would in\nnormal production cases.\n"
  example: []
  syntax:
    content: >-
      [OriginalName("ALPHA")]

      Alpha = 2
    return:
      type: Google.Api.LaunchStage
    content.vb: >-
      <OriginalName("ALPHA")>

      Alpha = 2
